al facilities, hobby clubs under SAC, sports facilities and cultural activities, etc.</p><p style=\"box-sizing: inherit; margin-bottom: 1rem; font-family: OpenSansRegular, Arial; font-size: 11pt; color: rgb(65, 62, 59); padding: 2px; background-color: rgb(241, 241, 241); display: inline; text-align: justify;\"><br></p><p style=\"box-sizing: inherit; margin-bottom: 1rem; font-family: OpenSansRegular, Arial; font-size: 11pt; color: rgb(65, 62, 59); padding: 2px; background-color: rgb(241, 241, 241); display: inline; text-align: justify;\"><br></p><p style=\"box-sizing: inherit; margin-bottom: 1rem; font-family: OpenSansRegular, Arial; font-size: 11pt; color: rgb(65, 62, 59); padding: 2px; background-color: rgb(241, 241, 241); display: inline; text-align: justify;\"><br></p><p style=\"box-sizing: inherit; margin-bottom: 1rem; font-family: OpenSansRegular, Arial; font-size: 11pt; color: rgb(65, 62, 59); padding: 2px; background-color: rgb(241, 241, 241); display: inline; text-align: justify;\"><br></p><p style=\"box-sizing: inherit; margin-bottom: 1rem; font-family: OpenSansRegular, Arial; font-size: 11pt; color: rgb(65, 62, 59); padding: 2px; background-color: rgb(241, 241, 241); display: inline; text-align: justify;\"><br></p><p style=\"box-sizing: inherit; margin-bottom: 1rem; font-family: OpenSansRegular, Arial; font-size: 11pt; color: rgb(65, 62, 59); padding: 2px; background-color: rgb(241, 241, 241); display: inline; text-align: justify;\"><iframe frameborder=\"0\" src=\"//www.youtube.com/embed/UJf3O-iRoFg\" width=\"640\" height=\"360\" class=\"note-video-clip\"></iframe></p><p style=\"box-sizing: inherit; margin-bottom: 1rem; font-family: OpenSansRegular, Arial; font-size: 11pt; color: rgb(65, 62, 59); padding: 2px; background-color: rgb(241, 241, 241); display: inline; text-align: justify;\"><br></p><p style=\"box-sizing: inherit; margin-bottom: 1rem; font-family: OpenSansRegular, Arial; font-size: 11pt; color: rgb(65, 62, 59); padding: 2px; background-color: rgb(241, 241, 241); display: inline; text-align: justify;\"><br></p><p style=\"box-sizing: inherit; margin-bottom: 1rem; font-family: OpenSansRegular, Arial; font-size: 11pt; color: rgb(65, 62, 59); padding: 2px; background-color: rgb(241, 241, 241); display: inline; text-align: justify;\"><br></p><p style=\"box-sizing: inherit; margin-bottom: 1rem; font-family: OpenSansRegular, Arial; font-size: 11pt; color: rgb(65, 62, 59); padding: 2px; background-color: rgb(241, 241, 241); display: inline; text-align: justify;\"><br></p><p style=\"box-sizing: inherit; margin-bottom: 1rem; font-family: OpenSansRegular, Arial; font-size: 11pt; color: rgb(65, 62, 59); padding: 2px; background-color: rgb(241, 241, 241); display: inline; text-align: justify;\">clickÂ <a href=\"https://sirtbhopal.ac.in/\" target=\"_blank\">Here</a> Â to visit our college site</p>                ', 1, 'a4asrahapost77026736602758275205620224.jpg', '2019-09-03', 'sirt sagar college', 36, 'published', 1),
(4, 'Best Engineering College in Bhopal, MP Central India', 'gourav', '<p><span style=\"color: rgb(97, 97, 97); font-family: OpenSansRegular, Arial; font-size: 15px; text-align: justify;\">The SAGE is the most emerging group of Engineering, Real state, Power &amp; Media companies in central India. It serves in the area of engineering education as a prime duty. It is working by the name of Sagar Group of Institutions (SGI) in the education sector. The Sagar Institute of Research &amp; Technology (SIRT) is the first Institution of SGI. It is among&nbsp;</span><span style=\"box-sizing: inherit; font-weight: bolder; font-family: OpenSansRegular, Arial; font-size: 15px; color: rgb(97, 97, 97); text-align: justify;\">Top engineering colleges in MP Madhya Pradesh India.</span><span style=\"color: rgb(97, 97, 97); font-family: OpenSansRegular, Arial; font-size: 15px; text-align: justify;\">&nbsp;It is a part of Sagar Group of Institutions which is also popularly called as Sagar Group or SIRT College in Bhopal. Ideally nested in the natural landscapes of Bhopal, the campus is well spread in 20 acres &amp; fully based on Vastu principles. It is rated&nbsp;</span><span style=\"box-sizing: inherit; font-weight: bolder; font-family: OpenSansRegular, Arial; font-size: 15px; color: rgb(97, 97, 97); text-align: justify;\">top engineering colleges in Bhopal MP India</span><span style=\"color: rgb(97, 97, 97); font-family: OpenSansRegular, Arial; font-size: 15px; text-align: justify;\">&nbsp;for its infrastructure, academic facilities, R&amp;D projects, rich collection of books and International Journals in the library.</span><span style=\"box-sizing: inherit; font-weight: bolder; font-family: OpenSansRegular, Arial; font-size: 15px; color: rgb(97, 97, 97); text-align: justify;\">&nbsp;The Sagar</span><span style=\"color: rgb(97, 97, 97); font-family: OpenSansRegular, Arial; font-size: 15px; text-align: justify;\">&nbsp;Group was in itself earlier working under patronage of Agrawal Group of Companies which is now named as The SAGE. It offers the education programs in Engineering, Pharmacy, Management, and Diploma. The SAGE is lead by the Chairman Er. Sanjeev Agrawal, who has been awarded more than 50 awards at National level and has a reputation of owning&nbsp;</span><span style=\"box-sizing: inherit; font-weight: bolder; font-family: OpenSansRegular, Arial; font-size: 15px; color: rgb(97, 97, 97); text-align: justify;\">best engineering colleges in Bhopal MP</span><span style=\"color: rgb(97, 97, 97); font-family: OpenSansRegular, Arial; font-size: 15px; text-align: justify;\">. The Group also consists of number of sister colleges including SIRT, SIRT-S, SIRT-E, and SIRT-Indore with total 25+ courses and now it has expanded and established the SAGE University at Indore in 2017. SIRT Bhopal has also received ISO certification: 9000-2001 in 2003, NBA Accreditation in 2009, 2014, 2016 and 2018. It has also been accredited by TCS in 2010 for closed campus placements. The Sagar Group conducts many events for students overall personality development by conducting expert lectures, industrial visits, workshops, value addition courses. Apart from this, the group has strong belief in spiritual development of students &amp; the faculty members.</span></p>', 0, 'gouravpost3253743040831205809335663info-header-1.jpg', '2019-09-04', 'sirt sagar college gourav', 9, 'published', 2),
(5, 'Chairman\'s Message', 'gourav', '<h3 style=\"box-sizing: inherit; margin-top: 0px; margin-bottom: 0.5rem; font-family: OpenSansRegular, Arial; line-height: 32px; color: rgb(198, 45, 20); font-size: 16pt;\">\"No Substitute to Hard Work, Sooner or Later It Gives Best Reward\"</h3><p style=\"box-sizing: inherit; margin-bottom: 1rem; font-family: OpenSansRegular, Arial; font-size: 15px; text-align: justify; padding: 2px; line-height: 30px; color: rgb(97, 97, 97);\">Hello friends, it gives me immense pleasure to talk to you as Chairman of Sagar Group of Institutions, Bhopal and Chancellor of SAGE University, Indore. I believe in core values, ethics and commitment which made Sagar Group what it is today. The students and staff members of Sagar Group are like my family members. I started my Journey in the field of Education in 2003 with SIRT College, Bhopal with an aim to produce world class Engineers, Managers and Pharmacists who can compete at any challenge in the world. I express my gratitude towards God that he has helped me in achieving my dreams and I further promise that I will continue to serve the society by giving back the best which I can.</p>', 0, 'gouravpost1221530348998155313296198Chairman.jpg', '2019-09-04', 'chairman', 13, 'published', 2),
(6, 'Chairperson\'s Message', 'vaibhav', '<h3 style=\"box-sizing: inherit; margin-top: 0px; margin-bottom: 0.5rem; font-family: OpenSansRegular, Arial; line-height: 32px; color: rgb(198, 45, 20); font-size: 16pt;\">â€œIf you work hard enough and assert yourself, and use your mind and imagination, you can shape the world to your desires.â€</h3><p style=\"box-sizing: inherit; margin-bottom: 1rem; font-family: OpenSansRegular, Arial; font-size: 15px; text-align: justify; padding: 2px; line-height: 30px; color: rgb(97, 97, 97);\">At Sagar Group of Institutions we would like to focus on grooming young minds as the pillar of advancement of a nation &amp; hope of the future. The members of a group aim to promote education and culture in all aspects in order to achieve and fulfill the mission statement that we believe in. We try to maintain academic standards which help our students to achieve remarkable and excellent results. At Sagar Group, we believe in humanity, discipline, punctuality, regularity. We nurture our students to become the world-class professionals who can accomplish the affirmed purpose of our great President, Honorable Abdul Kalam, to build our Nation a \"SUPER POWER\".</p>', 0, 'vaibhavpost618199923867321755329364Kiran_Agrawal.jpg', '2019-09-04', 'Chairperson\'s krian aggrawal', 16, 'published', 2),
(7, 'Vice Chairman\'s Message', 'vaibhav', '<h3 style=\"box-sizing: inherit; margin-top: 0px; margin-bottom: 0.5rem; font-family: OpenSansRegular, Arial; line-height: 32px; color: rgb(198, 45, 20); font-size: 16pt;\">â€œWe cannot always build the future for our students, but we can build our students for the futureâ€</h3><p style=\"box-sizing: inherit; margin-bottom: 1rem; font-family: OpenSansRegular, Arial; font-size: 15px; text-align: justify; padding: 2px; line-height: 30px; color: rgb(97, 97, 97);\">Words visualize the ambition and our aim is to educate the students to LEARN, not just STUDY. Besides providing a technical education, we motivate and educate our students to experience practical learning for real life. We firmly believe that education is the key to a nationâ€™s progress so it is our duty to provide the best academic training to the students. Thus, we emphasize more on learning modules. The institution endeavors to comfort the students with the required knowledge and skills to become successful in their respective fields. Hard work and discipline are the sure roads towards success. We will always support students in achieving their ambitions and also ensure that their stay in the college is meaningful and fruitful as well.</p>', 0, 'vaibhavpost843241600623870376453268Prashant-Jain.jpg', '2019-09-04', 'Prashant Jain Vice Chairman\'s Message', 16, 'published', 2),
(8, 'Innovations', 'rajiv', 'The Sagar Institute of  Research & Technology  is  among   top engineering colleges in Bhopal.   It  imparts top  class  education in  Engineering,  Management, Pharmacy, and Diploma. The field of technical education is full of design, creativity, and innovations. We at  Sagar Group, Bhopal , promote students to develop their real-life projects so that they  can  learn and gain  practical knowledge. Our  students  have developed 50+ national level projects  in various  courses. Our faculty members are highly skilled\r\n& specialized in their own area.\r\n', 1, 'rajivpost41649968246609013330024Prashant-Jain.jpg', '2019-09-04', 'hgvu', 17, 'published', 1);
