(9, 'APPLE APPLE IPHONE ', 'aranamour', '<p class=\"p--has-dropcap p-large-text drop-letter-i\" id=\"kkww3P\" style=\"text-decoration-line: inherit; vertical-align: inherit; font-family: Helvetica, sans-serif; font-size: 1.2rem; line-height: inherit; margin-bottom: 1.2rem; padding: 0px; color: rgb(66, 66, 66);\"><span aria-labelledby=\"word-first--0\" role=\"text\" style=\"text-decoration: inherit; vertical-align: inherit; font-family: inherit; font-size: inherit; font-style: inherit; line-height: inherit; margin: 0px; padding: 0px;\">tâ€™s</span>Â iPhone 11 announce day! Today, theÂ <a href=\"https://www.theverge.com/2019/9/6/20851690/apple-event-2019-iphone-11-rumors-preview-watch-ios-13-ipados-ipad\" style=\"text-decoration: inherit; vertical-align: inherit; font-family: inherit; font-size: inherit; font-style: inherit; line-height: inherit; margin: 0px; padding: 0px; color: rgb(226, 18, 122); transition: color 0.1s ease 0s, background-color 0.1s ease 0s, fill 0.1s ease 0s; border-bottom: 1px solid currentcolor;\">main things we are expecting</a>Â are three models of iPhones. Their precise names are still up in the air, but iPhone 11, iPhone 11 Pro, and iPhone 11 Pro Max all seem like the most likely candidates. Their most important new feature will probably be their camera system.</p><p id=\"5nNzKD\" style=\"text-decoration-line: inherit; vertical-align: inherit; font-family: Helvetica, sans-serif; font-size: 18px; line-height: inherit; margin-bottom: 1.2rem; padding: 0px; color: rgb(66, 66, 66);\">Beyond that, the Apple Watch seems likely, we might get those Apple Tag location trackers, and maybe even a revision of the Apple TV hardware. Who knows, there could be more, but the stuff weâ€™ve already mentioned is more than enough for one event.</p><p id=\"RGRI6J\" style=\"text-decoration-line: inherit; vertical-align: inherit; font-family: Helvetica, sans-serif; font-size: 18px; line-height: inherit; margin-bottom: 1.2rem; padding: 0px; color: rgb(66, 66, 66);\">