; line-height: inherit; margin-bottom: 1.2rem; padding: 0px;\"><span style=\"color: rgb(51, 51, 51); font-family: \"Open Sans\", sans-serif; font-size: 16px;\">Apple\'s big Sept. 10 event is in the books, giving us our official look at the iPhone 11, iPhone 11 Pro and iPhone 11 Pro Max, all of which are focused on delivering the best photography you can find in a phone. We also saw a new Apple Watch, a refreshed entry-level iPad and official prices and release dates forÂ </span><a href=\"https://www.tomsguide.com/reference/apple-arcade-games-price-release-date-and-more\" data-track-type=\"click\" data-index=\"1\" data-component=\"Inline links\" data-count=\"19\" style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: \"Open Sans\", sans-serif; font-size: 16px; vertical-align: baseline; color: rgb(138, 159, 173); background-color: rgb(255, 255, 255);\">Apple Arcade</a><span style=\"color: rgb(51, 51, 51); font-family: \"Open Sans\", sans-serif; font-size: 16px;\">Â andÂ </span><a href=\"https://www.tomsguide.com/us/apple-tv-plus-release-date-shows-price,news-29730.html\" data-track-type=\"click\" data-index=\"2\" data-component=\"Inline links\" data-count=\"19\" style=\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: \"Open Sans\", sans-serif; font-size: 16px; vertical-align: baseline; color: rgb(138, 159, 173); background-color: rgb(255, 255, 255);\">Apple TV Plus</a><span style=\"color: rgb(51, 51, 51); font-family: \"Open Sans\", sans-serif; font-size: 16px;\">.</span></p><p id=\"RGRI6J\" style=\"vertical-align: inherit; line-height: inherit; margin-bottom: 1.2rem; padding: 0px;\"><span style=\"color: rgb(51, 51, 51); font-family: \"Open Sans\", sans-serif; font-size: 16px;\"><br></span></p><p id=\"RGRI6J\" style=\"vertical-align: inherit